'''PoxStead College''' is an educational institution for [[Fairy|fairies]]. It was established more than 200 years ago and offers degrees in Advanced Healing. [[Fairy Nuff]] studied here and [[Dr Foster]] is or used to be the Head of Magical Healing at the college.{{CiteNPC |npc=Fairy Nuff |quote=I graduated over 200 human years ago. Look, there's my Advanced Healing Certificate on the wall.}}

